`,u.jsx(t.p,{children:"Currently, the SQS is focused on providing data from Internal Revenue Service Administrative Tax Records. This includes information returns from all workers receiving W-2s and independent contractors receiving 1099s, as well as 1040s from self employed or business income. However, earnings from self-employment by individuals who did not file a tax return will not be included. Data is only updated annually and will not include quarter by quarter wage reports."}),`
`,u.jsx(t.h3,{children:"How current are the IRS data youre matching to?"}),`
