`,u.jsx(t.h5,{children:"Cell"}),`
`,u.jsx(t.p,{children:"Any given record or variable in a record, the intersection of a row and column in a dataset. In the context of microdata, it refers to a specific entry in the data. In the context of tabulation, it refers to the results from a computation on entries in the microdata. Rarely: A subset of records, derived from belonging to a mutually exclusive category."}),`
`,u.jsx(t.h5,{children:"Complementary Subgroups"}),`
`,u.jsx(t.p,{children:"Distinct subsets of a set based on mutually exclusive variables which, when combined, form the whole of the dataset."}),`
`,u.jsx(t.h5,{children:"Complementary Suppression"}),`
`,u.jsx(t.p,{children:"Use of privacy preserving methods such as redaction or masking to ensure records cannot be identified by negative inference from the complementary subgroups of a dataset."}),`
`,u.jsx(t.h5,{children:"Data Governance Model"}),`
`,u.jsx(t.p,{children:"A combination of policies, people, processes, and technology which controls data access and use, defining data ownership, security, risk management, and compliance with laws and regulations."}),`
`,u.jsx(t.h5,{children:"Data Intermediary"}),`
`,u.jsx(t.p,{children:"An entity that facilitates sharing of and access to restricted data by third parties. This facilitation may include using Privacy Enhancing Technologies (PETs) in conducting linkages, creating data extracts, or computing statistics. Also known as a Trusted Third Party (TTP) or Honest Broker."}),`
`,u.jsx(t.h5,{children:"Data Controller"}),`
`,u.jsx(t.p,{children:"The organization that has the ability to control the access and storage of data, as well as what processing is done on that data."}),`
`,u.jsx(t.h5,{children:"Data Owner"}),`
`,u.jsx(t.p,{children:"The entity that has legal responsibility and control over a dataset."}),`
`,u.jsx(t.h5,{children:"Data Provisioning"}),`
`,u.jsx(t.p,{children:"A Data Provider permitting access to data for approved uses and users, typically through remote access or secure extracts employing methods that meet the security requirements of a data owner or controller."}),`
`,u.jsx(t.h5,{children:"Dataset"}),`
`,u.jsx(t.p,{children:"A collection of records which share a common set of variables and dimensions."}),`
`,u.jsx(t.h5,{children:"De-duplication"}),`
`,u.jsx(t.p,{children:"The process of eliminating redundant data in a dataset; may involve checking for exact or fuzzy matches."}),`
`,u.jsx(t.h5,{children:"De-identification"}),`
`,u.jsx(t.p,{children:"The process of removing or obscuring identifying values from records to ensure that data subjects cannot be re-identified from the remaining data. Different standards for de-identification exist, such as Safe Harbor and Expert Determination standards from HIPAA."}),`
`,u.jsx(t.h5,{children:"Differential Item Functioning"}),`
`,u.jsx(t.p,{children:"A source of bias in data analysis where different groups respond differently to a query due to a reason other than what that query was intended to measure. For example, if men and women feel the exact same pain from a given condition, but women interpret Serious Pain to occur at a greater threshold than men."}),`
`,u.jsx(t.h5,{children:"Differential Privacy"}),`
`,u.jsx(t.p,{children:"A stochastic framework for privacy preserving analysis which guards against significant influence of any one individual on the results."}),`
`,u.jsx(t.h5,{children:"Disclosure Avoidance"}),`
`,u.jsx(t.p,{children:"Practices to safeguard sensitive information while sharing data, to ensure no data elements are inadvertently shared with parties who should not have access to them. This may include practices such as K-Anonymity, L-Diversity, and T-Closeness."}),`
`,u.jsx(t.h5,{children:"Distance to Closest Record (DCR)"}),`
`,u.jsx(t.p,{children:"Distance to Closest Record is a comparison of the distribution of synthetic data to the original data it is meant to represent."}),`
`,u.jsx(t.h5,{children:"Distributed Ledger Technology"}),`
`,u.jsx(t.p,{children:"The use of a number of ledgers stored on networked devices instead of one local database to ensure data accuracy and security. Blockchains are a type of Distributed Ledger Technology. May be used in place of a Data Intermediary."}),`
`,u.jsx(t.h5,{children:"Encryption"}),`
`,u.jsx(t.p,{children:"The process of encoding data, usually for secure transmission or storage, so that a key (or passcode) is required to decrypt it and return it to its original, readable state."}),`
`,u.jsx(t.h5,{children:"Epsilon"}),`
`,u.jsx(t.p,{children:"A symbol used when applying differential privacy, it represents the privacy loss associated with the release of a dataset. See Privacy Loss Budget."}),`
`,u.jsx(t.h5,{children:"Extreme-value protection"}),`
`,u.jsx(t.p,{children:"A method for protecting privacy of data subjects who are represented by the minimum or maximum values of a given dataset, who may otherwise be at risk for reidentification if those maxima or minima were published in their raw form."}),`
`,u.jsx(t.h5,{children:"Fake data"}),`
`,u.jsx(t.p,{children:"Artificial data that can be used to test or demonstrate processes without the need to use real data that will have privacy concerns; unlike synthetic data, it is disconnected from any real datasets"}),`
`,u.jsx(t.h5,{children:"Federated Data Model"}),`
`,u.jsx(t.p,{children:"A data management approach where data remain siloed and secured at individual institutions, but are harmonized so queries may be run across the network."}),`
`,u.jsx(t.h5,{children:"Fuzzy Matching"}),`
`,u.jsx(t.p,{children:"A data linkage relying on probabilistic rather than exact matching, used when there is no unique key (such as a Social Security Number) to link on"}),`
`,u.jsx(t.h5,{children:"Homomorphic Encryption"}),`
`,u.jsx(t.p,{children:"An encryption method that allows mathematical operations to be performed on the data while it remains securely encrypted. Computationally intensive."}),`
`,u.jsx(t.h5,{children:"Honest Broker"}),`
`,u.jsx(t.p,{children:"See Data Intermediary"}),`
`,u.jsx(t.h5,{children:"Hybrid data"}),`
`,u.jsx(t.p,{children:"Data which is partially original data, but has synthetic data added."}),`
`,u.jsx(t.h5,{children:"Identity disclosure"}),`
`,u.jsx(t.p,{children:"The event where the identity of a record in an anonymized dataset is revealed or inferred."}),`
`,u.jsx(t.h5,{children:"Imputation"}),`
`,u.jsx(t.p,{children:"The estimation of a missing cell. May either be a single value, multiple values, or a probability distribution."}),`
`,u.jsx(t.h5,{children:"k-anonymity"}),`
`,u.jsx(t.p,{children:"A dataset of discrete values satisfies k-anonymity if there are a minimum of k-1 duplicates for any potentially identifying combination of fields in the data."}),`
`,u.jsx(t.h5,{children:"Linkage"}),`
`,u.jsx(t.p,{children:"The establishment of a mapping between some subset of records of two or more datasets."}),`
`,u.jsx(t.h5,{children:"Linked ID"}),`
`,u.jsx(t.p,{children:"An identity valid across multiple linked datasets."}),`
`,u.jsx(t.h5,{children:"Masking"}),`
`,u.jsx(t.p,{children:"The substitution of a predetermined symbol for a particular cell, used in order to prevent disclosure."}),`
`,u.jsx(t.h5,{children:"MD5"}),`
`,u.jsx(t.p,{children:"A popular Secure Hashing algorithm that performs a functionally one-way conversion of a string of text into a hashed value. One application is for two actors to compare the MD5 values generated by passing the datasets through the algorithm to determine whether they have identical datasets without disclosing any aspect of their data."}),`
`,u.jsx(t.h5,{children:"Metadata"}),`
`,u.jsx(t.p,{children:"Information about how a given dataset was collected, digitized, processed, evaluated, or otherwise came into its current form."}),`
`,u.jsx(t.h5,{children:"Noise"}),`
`,u.jsx(t.p,{children:"Probabilistic output with no structure."}),`
`,u.jsx(t.h5,{children:"Noise addition"}),`
`,u.jsx(t.p,{children:"The incorporation of noise with real data in order to obscure some aspect of that real data."}),`
`,u.jsx(t.h5,{children:"Outlier"}),`
`,u.jsx(t.p,{children:"A datapoint which does not fit with the overall trend of a dataset."}),`
`,u.jsx(t.h5,{children:"Overfitting"}),`
`,u.jsx(t.p,{children:"A pernicious situation in predictive analysis in which coincidental patterns in the training dataset have been incorporated into the prediction algorithm."}),`
`,u.jsx(t.h5,{children:"Perturbation"}),`
`,u.jsx(t.p,{children:"A (typically small) change to an existing datapoint, often intended to aid in anonymization."}),`
`,u.jsx(t.h5,{children:"PET"}),`
`,u.jsx(t.p,{children:"Privacy Enhancing Technology; any technology applied in a data analysis with the intent of preventing that data analysis from revealing private information about the underlying dataset. Also known as Privacy Preserving Technology (PPT)."}),`
`,u.jsx(t.h5,{children:"PHI"}),`
`,u.jsx(t.p,{children:"Protected Health Information, which is defined under HIPAA to include individually identifiable health information related to health conditions, healthcare, or health care payments and can be used to identify the associated individual."}),`
`,u.jsx(t.h5,{children:"PII"}),`
`,u.jsx(t.p,{children:"Personally Identifying Information; any information which may be used, alone or in conjunction with other information, to disclose an individual's identity."}),`
`,u.jsx(t.h5,{children:"Plaintext"}),`
`,u.jsx(t.p,{children:"A means of storing digital data which allows its contents to be easily read by anyone in possession of it."}),`
`,u.jsx(t.h5,{children:"Privacy Loss Budget"}),`
`,u.jsx(t.p,{children:"A defined limit of the trade-off between data utility and privacy, for any given application. Often expressed using the symbol Epsilon."}),`
`,u.jsx(t.h5,{children:"Privacy Preserving Record Linkage (PPRL)"}),`
`,u.jsx(t.p,{children:"Combining records from two or more data sources in such a way as to prevent disclosure."}),`
`,u.jsx(t.h5,{children:"Privacy Preserving Technologies (PPTs)"}),`
`,u.jsx(t.p,{children:"See PET."}),`
`,u.jsx(t.h5,{children:"Private Query Servers"}),`
`,u.jsx(t.p,{children:"Computer systems that allow for a limited set of queries on stored data (such as count and attributes for specific groups) while maintaining privacy. May utilize secure multiparty computation or differential privacy."}),`
`,u.jsx(t.h5,{children:"Pseudo ID"}),`
`,u.jsx(t.p,{children:'Any information not traditionally or legally considered part of "identity" but which is nevertheless sufficiently unique to identify an individual.'}),`
`,u.jsx(t.h5,{children:"Pseudonymisation"}),`
`,u.jsx(t.p,{children:"The replacement of identifying information with artificial identifiers. Sometimes considered to be an outdated approach to privacy due to limits and the potential of re-identification."}),`
`,u.jsx(t.h5,{children:"Quasi-Identifiers (QIDs)"}),`
`,u.jsx(t.p,{children:"Information that cannot identify a specific person alone but may do so when combinded with other Quasi-Identifiers. Also known as indirect identifiers."}),`
`,u.jsx(t.h5,{children:"Query"}),`
`,u.jsx(t.p,{children:"A retrieval of data based on specified criteria."}),`
`,u.jsx(t.h5,{children:"Random data generation"}),`
`,u.jsx(t.p,{children:"The process of generating Fake Data."}),`
`,u.jsx(t.h5,{children:"Rare category protection"}),`
`,u.jsx(t.p,{children:"Methodology deployed with the intent to prevent the disclosure of rare categories due to the fact that rare categories can readily be used as Quasi-Identifiers (QIDs)."}),`
`,u.jsx(t.h5,{children:"Redaction"}),`
`,u.jsx(t.p,{children:"The removal of sensitive data elements from a dataset."}),`
`,u.jsx(t.h5,{children:"Re-identification"}),`
`,u.jsx(t.p,{children:"The circumvention of an anonymization procedure which allows the recipients of an anonymized dataset to recuperate some subset of the identities corresponding to records."}),`
`,u.jsx(t.h5,{children:"Restricted Data"}),`
`,u.jsx(t.p,{children:"Data which cannot be accessed directly by the public, by force of law, ethical convention, or other agreement."}),`
`,u.jsx(t.h5,{children:"Rule-based data generation"}),`
`,u.jsx(t.p,{children:"The generation of data using an algorithm crafted by hand; used in contradistinction to data created on the basis of a training set."}),`
`,u.jsx(t.h5,{children:"Safelisting"}),`
`,u.jsx(t.p,{children:"The approval of a given privacy technology or infrastructure element by IT, security, and legal departments, after it has been ensured it satisfies their legal and regulatory requirements."}),`
`,u.jsx(t.h5,{children:"Sampling"}),`
`,u.jsx(t.p,{children:"The probabilistic selection of a subset of records of a dataset."}),`
`,u.jsx(t.h5,{children:"Secure Hashing"}),`
`,u.jsx(t.p,{children:"The use of a hashing algorithm (such as MD5) to replace a data element with a seemingly random string of characters which are (for all practical purposes) computationally impossible to revert to the original data element, but trivial to find again using the same algorithm on the original element, which always results in an identical hashed value."}),`
`,u.jsx(t.h5,{children:"Secure Multiparty Computation (SMC)"}),`
`,u.jsx(t.p,{children:"The technological process which allows parties with independent datasets to conduct a query across both datasets without ever having access to the others secure dataset."}),`
`,u.jsx(t.h5,{children:"Secure Virtual Enclave"}),`
`,u.jsx(t.p,{children:"A computing workspace that allows authorized users to access sensitive datasets securely for analysis without risk of inadvertent disclosure. Also known as a Trusted Execution Environment."}),`
`,u.jsx(t.h5,{children:"SLK"}),`
`,u.jsx(t.p,{children:"A Statistical Linkage Key, a value either collectable or derivable from other data elements that can be used to connect datasets. The SLK-581 was one such method of deriving a key that was popular in research dealing with Australian health data."}),`
`,u.jsx(t.h5,{children:"Smart Contract"}),`
`,u.jsx(t.p,{children:"A digital contract document that contains logical rules that allow changing access to data based on predetermined conditions, associated with the use of distributed ledger technologies."}),`
`,u.jsx(t.h5,{children:"SMC"}),`
`,u.jsx(t.p,{children:"See Secure Multiparty Computation"}),`
`,u.jsx(t.h5,{children:"Statistical Disclosure Limitation (SDL)"}),`
`,u.jsx(t.p,{children:"Methods such as aggregation, rounding, and suppression of results to protect any individuals from being re-identifiable based on statistical results."}),`
`,u.jsx(t.h5,{children:"Statistical parity"}),`
`,u.jsx(t.p,{children:"When two groups in a dataset have the same average of a given data element."}),`
`,u.jsx(t.h5,{children:"Suppression"}),`
`,u.jsx(t.p,{children:"The redaction of a component of an analysis, typically in order to prevent that analysis from resulting in a disclosure."}),`
`,u.jsx(t.h5,{children:"Synthetic data"}),`
`,u.jsx(t.p,{children:"A dataset generated on the basis of one or more training data in such a manner as to avoid any one-to-one correspondence between records of the synthetic dataset and records of any training datasets."}),`
`,u.jsx(t.h5,{children:"Target data"}),`
`,u.jsx(t.p,{children:"In the context of a Fake Dataset or Synthetic Dataset, the dataset which they are meant to represent, which is typically not directly releasable."}),`
`,u.jsx(t.h5,{children:"Threat Model"}),`
`,u.jsx(t.p,{children:"An analysis of possible motivations and methods a potential attacker of a datasystem may have."}),`
`,u.jsx(t.h5,{children:"Thresholds"}),`
`,u.jsx(t.p,{children:"Predefined limits used to categorize when a privacy preserving technology must be used. For example, minimum cell size."}),`
`,u.jsx(t.h5,{children:"Token, or Hash"}),`
`,u.jsx(t.p,{children:"The value resulting from the use of a Secure Hashing Algorithm."}),`
`,u.jsx(t.h5,{children:"Trusted Execution Environment (TEE)"}),`
`,u.jsx(t.p,{children:"See Secure Virtual Enclave."}),`
`,u.jsx(t.h5,{children:"Zero-Knowledge Proof"}),`
